        let info = [
            { id: 1, name: "Jon Snow", img: "./img/Jon_snow.jpg", position: "Kit Harington", phone: "0541412724", email: 'King@gmail.com', website: "ironThrone.com" },
            { id: 2, name: "Cersei Lannister", img: "./img/cersei.jpg", position: "Lena Headey", phone: "0500000000", email: 'Queen@gmail.com', website: "ironThrone.com" },
            { id: 3, name: "Daenerys Targaryen", img: "./img/daenerys.jpg", position: "Emilia Clarke", phone: "0599999999", email: 'calisi@gmail.com', website: "ironThrone.com" },
            { id: 4, name: "Terrian Lannister", img: "./img/terrian.jpg", position: "Peter Dinklage", phone: "0511111111", email: 'Hand@gmail.com', website: "ironThrone.com" },
            { id: 7, name: "Jaime Lannister", img: "./img/jaime.jpg", position: "Nikolaj Coster-Waldau", phone: "0000000000", email: 'north@gmail.com', website: "ironThrone.com" },
            { id: 5, name: "Arya Stark", img: "./img/arya.jpg", position: "Maisie Williams", phone: "0000000000", website: "ironThrone.com" },
            { id: 6, name: "Sansa Stark", img: "./img/sansa.jpg", position: "Sophie Turner", phone: "0000000000", email: 'north@gmail.com', website: "ironThrone.com" },
            { id: 8, name: "Ramsay Bolton", img: "./img/ramsy.jpg", position: "Iwan Rheon", phone: "0000000000", email: 'north@gmail.com', website: "ironThrone.com" },
            { id: 9, name: "Tywin Lannister", img: "./img/tywin.jpg", position: "Charles Dance", phone: "0000000000", email: 'north@gmail.com', website: "ironThrone.com" },
            { id: 10, name: "Ygritte", img: "./img/ygritte.jpg", position: "Rose Leslie", phone: "0000000000", email: 'north@gmail.com', website: "ironThrone.com" },
            { id: 11, name: "Melisandre", img: "./img/melisandre.jpeg", position: "Carice van Houten", phone: "0000000000", email: 'north@gmail.com', website: "ironThrone.com" },
            { id: 12, name: "Night King", img: "./img/nightKing.jpeg", position: "Vladimir Furdik", phone: "0000000000", email: 'north@gmail.com', website: "ironThrone.com" },

        ];
        const members = info.map(member => (
            <TeamMember
                key={member.id} // Unique key prop for each child
                name={member.name}
                img={member.img}
                position={member.position}
                phone={member.phone}
                email={member.email || 'N/A'} // Fallback for missing email
                website={member.website}
            />
        ));
        return (
            <div className="row">
                {members}
            </div>
        )
    }


}
export default Team;
